odataka neće imati nikakve negativne posledice po Vas. ";export const datasharing_15_new="Kako bi studija bila uspešna, molimo Vas da:";export const datasharing_15_opt1="napišete bar jednu objavu na mreži";export const datasharing_15_opt2="objavite bar tri komentara";export const datasharing_15_opt3="date bar jedan “lajk”";export const retentionHEADING_16=[/*#__PURE__*/_jsx("strong",{children:"Za\u0161tita podataka"})];export const retention_17="Vaše lične podatke tretiramo potpuno anonimno u skladu sa zakonskim propisima (Opšta uredba o zaštiti podataka – GDPR u Evropskoj uniji i Evropskom ekonomskom prostoru).";export const furtherHEADING_18="Vaše lične podatke će obrađivati partnerska institucija Institut Jožef Stefan (JSI) kao treće lice. To znači da će Vaši podaci prikupljeni prilikom korišćenja platforme TWON i prilikom odgovaranja na naše upitnike biti pohranjeni u toj organizaciji. Imamo ugovore sa ovim partnerima kako bismo osigurali zaštitu Vaše privatnosti.";export const further_19=[/*#__PURE__*/_jsx("strong",{children:"Deljenje podataka"})];export const complaints_20="Rezultati ove studije mogu biti podeljeni sa drugim istraživačima i/ili objavljeni putem javne baze podataka (open access), bez ličnih podataka ili informacija koje mogu pojedinačno identifikovati učesnike. Rezultati mogu biti korišćeni i u budućim istraživanjima na teme koje nisu nužno povezane sa ovom studijom.";export const best_21=[/*#__PURE__*/_jsx("strong",{children:"Period \u010Duvanja podataka"})];export const nme_22="Istraživački podaci biće čuvani najmanje 10 godina. Veza između ličnih podataka koji Vas direktno identifikuju (Vaših kontakt podataka i potpisanog informativnog pisma) i istraživačkih podataka biće uništena što je pre moguće.";export const consentHEADING_23=[/*#__PURE__*/_jsx("strong",{children:"Dodatne informacije"})];export const weitere="Podsećamo Vas da ukoliko imate bilo kakva pitanja u vezi sa studijom možete kontaktirati odgovornog istraživača Majkla Hezeltajna